import React from 'react';
import Product from './Product';
import data from './data';

class Products extends React.Component {
  render() {
    return (
      <div>
        {data.map((product) => (
          <Product key={product.name} product={product} />
        ))}
      </div>
    );
  }
}

export default Products;
